public kernel void get_all_last_GLOBAL_WIDTH_neighbors(
    global const float *input_neighbors,
    global float *output_neighbors) {

    int offset = GLOBAL_WIDTH - 1;

    for (int y = 0; y < GLOBAL_HEIGHT; ++y) {
        for (int x = 0; x < GLOBAL_WIDTH; ++x) {
            output_neighbors[ y * GLOBAL_WIDTH + (x+offset) ]
