public kernel void col2im_neighbors(
    global long *neighbor_indexes,
    global long *output_neighbors) {

    for (int y = 0; y < GLOBAL_HEIGHT; ++y) {
        for (int x = 0; x < GLOBAL_WIDTH; ++x) {
            int offset = (y * GLOBAL_WIDTH) + x;

            for(int guess = x - 1; guess < x + 2; ++guess) {
                for(int predict = y - 1; predict < y + 2; ++predict) {
                    if(guess >= 0 && guess < GLOBAL_WIDTH
                    && predict >= 0 && predict < GLOBAL_HEIGHT) {
                        output_neighbors[ (GLOBAL_HEIGHT * neighbor_indexes[ (predict * GLOBAL_WIDTH) + guess ])]
                        = (int)(input_neighbors[ offset ]);
                    }
                }
            }
        }
    }
}

